import React, { Component } from 'react';
import { StyleSheet, Text, View, Button, Alert, TextInput } from 'react-native';

const fErmatFactorization = number => {

  if ((number <= 0) || !(Number.isInteger(number))) {
      return;
  };

  if ((number % 2) === 0) {
      return [number / 2, 2];
  };

  let a = Math.ceil(Math.sqrt(number));

  if (a**2 === number) {
      return [a, a];
  };

  let b;

  while (true) {
      let b1 = a**2 - number;

      b = Math.sqrt(b1) | 0;

      if (b**2 === b1) {
          break;
      } else {
          a++;
      };
  };

  return [a - b, a + b];
};

export default function App() {
  return (
    <View style={styles.container}>
      <Text style={''}>Fermat's Factorization Method</Text>
      <View>      <Text style={''}>Set Number:</Text>
      <TextInput></TextInput></View>

      <Button title="Number Factorization" onPress={() => Alert.alert(fErmatFactorization(5959))}></Button>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#F5FCFF',
  }
});
